  text-align: center;
  z-index: 1;
}

.landing-text h1 {
  font-size: 15rem;
  font-family: "Roboto", sans-serif;
  background: linear-gradient(to top, #FF414E, #FF8928);
  /* background: linear-gradient(to right, #434343 0%, black 100%); */
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  padding: 1rem;
  user-select: none;
}

.landing-text h5 {
